import React from "react";

import teamImg from "../assets/team.svg";
import shareImg from "../assets/share.svg";
import upvoteImg from "../assets/upvote.svg";

const HomeCards = () => {
  return (
    <div class="ui three column stackable grid">
      <div class="column">
        <div class="image">
        <img src={teamImg} width="100%" height="400" alt="Team" />

        </div>
        <div class="center content">
        <h1 className="text-center">Search for hackathons</h1>
        </div>
      </div>

      <div class="column">
        <div class="image">
        <img src={shareImg} width="100%" height="400" alt="Share" />
        </div>
        <div class="center content">
        <h1 className="text-center">Share your experiences anonymously</h1>
        </div>
      </div>

      <div class="column">
        <div class="image">
        <img src={upvoteImg} width="100%" height="400" alt="Upvote" />
        </div>
        <div class="center content">
        <h1 className="text-center">Support others' reviews</h1>
        </div>
      </div>
    </div>
  );
};

export default HomeCards;

